CREATE DEFINER=`root`@`localhost` PROCEDURE `CreateSession`(
		ServerID INT
    )
BEGIN
	DELETE FROM online_players WHERE server_id = ServerID;
	INSERT INTO session (server_id, start)
    VALUES (ServerID, NOW());
    SELECT LAST_INSERT_ID() AS SessionID;
END ;;
